import React from 'react';

export default function Course(props) {
    let time = props.course['time']['start'] + ' - ' + props.course['time']['end'];

    return (
        <>
            <div
                className="cs-course"
                style={{
                    '--start-hour'   : props.course['time']['start']['hour'],
                    '--start-minute' : props.course['time']['start']['minute'],
                    '--end-hour'     : props.course['time']['end']['hour'],
                    '--end-minute'   : props.course['time']['end']['minute'],
                    '--color'        : props.course['color'],
                    '--course-index' : props.course_index,
                    '--hour-index'   : props.hour_index
                }}>

                <span className="cs-course-code">
                    {props.course['course']}
                </span>

                <span className="cs-course-room">
                    {props.course['room']}
                </span>

                <span className="cs-course-instructor">
                    {props.course['instructor']}
                </span>

                <span className="cs-course-time">
                    {time}
                </span>

                <span className="cs-course-days">
                    {days}
                </span>
            </div>
        </>
    );
}
